import React from "react";

function Museums() {
  const museums = [
    {
      name: "The Louvre",
      location: "Paris, France",
      image: "https://upload.wikimedia.org/wikipedia/commons/thumb/a/af/Louvre_Museum_Wikimedia_Commons.jpg/800px-Louvre_Museum_Wikimedia_Commons.jpg",
    },
    {
      name: "The British Museum",
      location: "London, United Kingdom",
      image: "https://upload.wikimedia.org/wikipedia/commons/thumb/a/a3/British_Museum_from_NE_2.JPG/800px-British_Museum_from_NE_2.JPG",
    },
    {
      name: "The Metropolitan Museum of Art",
      location: "New York, USA",
      image: "https://upload.wikimedia.org/wikipedia/commons/thumb/3/32/Metropolitan_Museum_of_Art_%28The_MET%29_New_York_City.jpg/800px-Metropolitan_Museum_of_Art_%28The_MET%29_New_York_City.jpg",
    },
  ];

  return (
    <div style={styles.container}>
      <h1 style={styles.title}>Explore Popular Museums</h1>
      <div style={styles.museumList}>
        {museums.map((museum, index) => (
          <div key={index} style={styles.card}>
            <img src={museum.image} alt={museum.name} style={styles.image} />
            <h2 style={styles.name}>{museum.name}</h2>
            <p style={styles.location}>{museum.location}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

const styles = {
  container: {
    padding: "40px",
    backgroundColor: "#f5f5f5",
    minHeight: "90vh",
  },
  title: {
    textAlign: "center",
    fontSize: "36px",
    marginBottom: "30px",
    color: "#2E8B57",
  },
  museumList: {
    display: "flex",
    justifyContent: "center",
    flexWrap: "wrap",
    gap: "30px",
  },
  card: {
    backgroundColor: "white",
    padding: "20px",
    borderRadius: "12px",
    boxShadow: "0 4px 8px rgba(0,0,0,0.1)",
    width: "250px",
    textAlign: "center",
  },
  image: {
    width: "100%",
    height: "150px",
    objectFit: "cover",
    borderRadius: "10px",
    marginBottom: "15px",
  },
  name: {
    fontSize: "20px",
    color: "#333",
    marginBottom: "5px",
  },
  location: {
    fontSize: "16px",
    color: "#777",
  },
};

export default Museums;
